function Selector(a){this.elements={};this.elementsStructure={};this.config={selector:"select.selector-instance"};this.parameters=a;this.core()}Selector.prototype.core=function(){this.getElements();for(let i=0;i<this.elements.length;++i){this.createInstance(this.elements[i])}};Selector.prototype.getElements=function(){this.elements=document.querySelectorAll(this.config.selector)};Selector.prototype.createInstance=function(a){this.saveContent(a);this.renderInstance();this.createEvents()};Selector.prototype.saveContent=function(a){let elementName=a.tagName.toLowerCase();this.elementsStructure[elementName]={};let attributes=a.attributes;for(let i=0;i<attributes.length;++i){this.elementsStructure[elementName][attributes[i].name]=attributes[i].value}for(let i=0;i<a.childElementCount;++i){let childElementName=a[i].tagName.toLowerCase();this.elementsStructure[elementName][i]={};this.elementsStructure[elementName][i].tag=childElementName;let childAttributes=a[i].attributes;for(let j=0;j<childAttributes.length;++j){this.elementsStructure[elementName][i][childAttributes[j].name]=childAttributes[j].value}}};